  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Hawaiian
  Islands NWR outlines Refuge accomplishments during the 1990 calendar year. The report
  begins with a summary of the year's highlights and weather conditions. The report
  includes a planning section which discusses the master plan, compliance with environmental
  and cultural resource mandates, and research and investigations. Refuge administration
  is outlined; information about personnel, volunteer programs, funding, safety, and
  technical assistance is given. Habitat management is also covered; subjects include
  wetlands and pest control. The wildlife section of the report discusses endangered
  and threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
  marine mammals, scientific collections, and marking and banding. The public uses
  of the Refuge described in this report include interpretive programs and law enforcement.
  The equipment and facilities section of the report provides information about rehabilitation,
  major maintenance, equipment replacement, and communication systems. Cooperative
  programs and items of interest are provided at the end. Refuge brochures and a fact
  sheet for the Northwestern Hawaiian Islands Refuge Complex are attached.\",\n\t\"license_title\":
